INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.', 'Preface First', 'full_html'),
(2, 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.', 'Preface Middle', 'full_html'),
(3, 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.', 'Preface Last', 'full_html'),
(4, '<h2>uLytics</h2>\r\n          <p>Breakthrough Marketing OS</p>\r\n          <p>Transforming B2B Marketing to B2S (Buyer to Seller)<br>\r\n            Built with Love &amp; Passion in San Francisco</p>', 'Tab one content', 'full_html'),
(5, ' <div class="row">            \r\n<div class="4u 12u$(medium)">\r\n              <header>\r\n                <h2>Turn your customer digital body language into actionable\r\n                  insights</h2>\r\n              </header>\r\n            </div>\r\n            <div class="4u 12u$(medium)">\r\n              <p>uLytics utilizes numerous natural language processing (NLP)\r\n                techniques to build the customer personas derived from their\r\n                content consumption habits.</p>\r\n            </div>\r\n            <div class="4u$ 12u$(medium)">\r\n              <p>User demographic and behavior data is stored in a graph\r\n                database with nodes and relationships. Utilizing advanced\r\n                analytics allows us to create recommendation models and\r\n                determine similar segments for intelligent 1-1 marketing.</p>\r\n            </div>\r\n  </div>', 'Tab two content', 'full_html'),
(6, ' <header>\r\n          <h2>Understand &amp; Identify</h2>\r\n          <p>Understand and build user personas by observing your customer''s\r\n            digital body language</p>\r\n        </header>\r\n        <p>We translate your customer''s digital behavior in to content level\r\n          entities that can be used to build personas and perform\r\n          micro-targeting </p>', 'Tab three', 'full_html'),
(7, '        <header>\r\n          <h2>Acquire &amp; Engage</h2>\r\n          <p>Utilize personas and uLytics suite of products<span style="font-style: italic;"></span>\r\n            to accurately acquire and engage new &amp; current customers</p>\r\n        </header>\r\n        <p>Our state of the art technology provides you an intuitive way to\r\n          target and engage your current and prospective customers via various\r\n          marketing channels.</p>', 'Tab four content', 'full_html');
